import React from 'react';
import {Box, Button, Center, Flex, Input, Stack} from "@chakra-ui/react";

const Home = () => {
    return (
        <Box bg={'#F7FAFC'} minHeight={'100vh'} w={'100%'}>
            <Box p={8}>
                <Stack boxShadow={'md'}
                       borderRadius={'10px'}
                       bg={'white'} p={'100px'}
                       direction={'row'}
                       maxW={'800px'}>
                    <Input minH={'50px'} placeholder={'Enter a join code'}/>
                    <Button minH={'50px'}
                            bgGradient="linear(to-l, #7928CA, #FF0080)"
                            color={'white'}>Join</Button>
                </Stack>
            </Box>


        </Box>
    );
};

export default Home;
